var Ac4yServiceConstant=require("../constant/Ac4yServiceConstant.js");
var Ac4yLCDStage=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCDStage.js");
var Ac4yLCFStage=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCFStage.js"); 

class Ac4ySLCDStage extends Ac4yLCDStage {
    
    createSelf(object) {return new Ac4ySLCDStage(object);}
 
    reachesWaiting4Response(){this.becomes(new Ac4yLCFStage({name: new Ac4yServiceConstant().STAGE.waiting4Response}));};

} // Ac4ySLCDStage

module.exports=Ac4ySLCDStage
